'use strict';
let GetPriceFeedMessage = require('./GetPriceFeedMessage.js');
class GetPriceFeedMessageBuilder extends GetPriceFeedMessage {
    setSymbol(symbol) {
        this.symbol = symbol;
    }
    setRequestId(requestId) {
        this.requestId = requestId;
    }
    setOfferId(id) {
        this.offerId = id;
    }
    setError(error) {
        this.error = error;
    }
    setOffer(offer) {
        this.offer = offer;
    }
    build() {
        return this;
    }
}
module.exports = GetPriceFeedMessageBuilder
